import './App.css';

function App() {
    return (
        <div className="App">
            <title>Give Me The Recipe</title>
            <header className="App-header">
                <h1>Give Me The Recipe</h1>
            </header>
            <body>
            <label htmlFor="url">Enter URL and hit Submit</label>
            <input type="text" id="url"/>
            </body>
        </div>
    );
}

export default App;
